import React from "react";
import Card from "./Card";
import Sdata from "./sdata";

const App =()=>
(
    <div>

    <h1 className ="heading_style">List of top 5 Netflix in 2020</h1>
    {Sdata.map((val,index) =>
    {
        console.log(index);
        return(
          
            <Card
              key={val.id}
             imgsrc ={val.imgsrc}
             
        title =  {val.title}
        sname ={val.sname}
        link ={val.link}
    />

        );
    })}
    </div>
   
   
    );

    export default App;
